/**@jsxImportSource @emotion/react */
import { css } from "@emotion/react";
import React from "react";
import { Company, getCompanyAsync } from "../data/companies";
import { useParams } from "react-router-dom";
import Page from "./Page";

interface Props {
  accountNumber: number;
}

const Dealer = () => {
  const { accountNumber } = useParams();

  const [company, setCompany] = React.useState<Company | undefined>(undefined);

  React.useEffect(() => {
    const doGetCompany = async () => {
      let company = await getCompanyAsync(parseInt(accountNumber));

      setCompany(company);
    };

    doGetCompany();
  }, [accountNumber]);

  return (
    <Page title={`Update licenses from ${company?.CompanyName}`}>
      <div
        css={css`
          text-align: center;
        `}
      >
        <p>Desktop Licenses: {company?.Licenses}</p>
        <p>Mobile Licenses: {company?.LicensesMobileCount}</p>
        <p>Trial Licenses: {company?.TrialLicenses}</p>
      </div>
    </Page>
  );
};

export default Dealer;
